var title_f2_62_3044="Hindfoot forefoot mobility test";
var content_f2_62_3044=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F68127&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F68127&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 475px\">",
"   <div class=\"ttl\">",
"    Hindfoot and forefoot mobility testing",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 455px; height: 435px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A, B) Note the interdependence between the hindfoot and the forefoot, the heel, first metatarsal head, and fifth metatarsal head have a tripod relationship. When the first metatarsal is pronated, the forefoot supinates to get the first and fifth metatarsal heads flat on the floor and the hindfoot inverts. (C, D) In the Coleman standing lateral block test, the heel and lateral border of the foot are on a 1.5-inch block, and the first and second metatarsals dangle at the edge of the block into pronation. When mobility is present between the hindfoot and the forefoot, the heel moves to its normal position of 5 degrees eversion. (E, F) In the Carroll test, the patient stands with his hindfoot on a 2 or 3-inch wooden block (or a hard book) and the forefoot dangles free at the edge of the block. When flexibility between the hindfoot and forefoot is normal, the heel everts to normal position.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Tachdjian, MO. Clinical pediatric orthopedics: the art of diagnosis and principles of management. Appleton &amp; Lange, Stamford, CT 1997. p.52. Copyright &copy; 1997 McGraw-Hill.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
