var title_f2_62_3045="Breast MRI of breast cancer recurrence";
var content_f2_62_3045=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F74918&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F74918&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Breast MRI of breast cancer recurrence",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 366px; height: 658px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Breast MRI can be used to differentiate postoperative scarring from breast cancer recurrence. This series depicts a patient with a prior history of right lumpectomy for invasive carcinoma who presented for annual mammography.",
"    <br>",
"     (A) The mammogram shows a new irregular mass posterior to the lumpectomy bed in the posterior central right breast (arrow).",
"     <br>",
"      (B) Sagital MRI images demonstrate a low signal mass in the posterior inferior right breast on the T2-weighted MRI image and on the pre-gadolinium enhanced T1-weighted image.",
"      <br>",
"       (C) Subtraction of the pre and post contrast sagittal T1-weighted images of the right breast shows an enhancing mass in the posterior central right breast confirming suspicion for recurrence. Biopsy revealed recurrent invasive ductal carcinoma.",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
