var title_f2_62_3052="Reducing the supply of fibril precursors in systemic amyloidosis";
var content_f2_62_3052=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F87769&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F87769&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Reducing the supply of fibril precursors in systemic amyloidosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Disease",
"       </td>",
"       <td class=\"subtitle1\">",
"        Aim of treatment",
"       </td>",
"       <td class=\"subtitle1\">",
"        Example of treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AA amyloidosis",
"       </td>",
"       <td>",
"        Suppress the acute phase response and thereby reduce the production of serum amyloid A protein",
"       </td>",
"       <td>",
"        <p>",
"         Antiinflammatory and immunosuppressive therapy in patients with rheumatoid arthritis and Crohn's disease (eg, anti-TNF antibodies)",
"        </p>",
"        <p>",
"         Colchicine for patients with familial Mediterranean fever",
"        </p>",
"        Surgery for patients with osteomyelitis and rare cytokine-producing tumors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AL amyloidosis",
"       </td>",
"       <td>",
"        Suppress production of monoclonal immunoglobulin light chains",
"       </td>",
"       <td>",
"        Chemotherapy directed at plasma cell dyscrasia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hereditary amyloidosis",
"       </td>",
"       <td>",
"        Eliminate source of genetically variant protein",
"       </td>",
"       <td>",
"        Orthotopic liver transplantation for patients with familial amyloid polyneuropathy secondary to variant transthyretin or renal amyloidosis secondary to variant fibrinogen A &alpha;-chain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &beta;",
"        <sub>",
"         2",
"        </sub>",
"        -microglobulin amyloidosis",
"       </td>",
"       <td>",
"        Reduce plasma concentration of &beta;",
"        <sub>",
"         2",
"        </sub>",
"        -microglobulin",
"       </td>",
"       <td>",
"        Renal transplantation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted by permission from: Macmillan Publishers Ltd: Nature Clinical Practice Nephrology. Gillmore JD, Hawkins PN. Drug insight: Emerging therapies for amyloidosis. Nat Clin Pract Nephrol 2006; 2:263. Copyright &copy; 2006.",
"     <a href=\"file://www.nature.com/nrneph\" style=\"FONT-STYLE: italic\" target=\"_blank\">",
"      www.nature.com/nrneph",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
